import React from 'react';
import { Container, Image } from 'react-bootstrap';
import '../home.css';


const Home:React.FC = () => {
    return (
     <Container className='mt-5' fluid >
        <h1 className='header'>  Hi! I'm Ionut Ciornei </h1>
        <h5 className='style'>
            Hello! I'm Ionut Ciornei, and I turn coffee into code. <br /> I come from a driver background and am currently on an <br /> exciting journey to pivot my career towards frontend <br /> development. 
        </h5>
        <Image src="/img/me.jpg" alt="me" className='imgStyle'/>
     </Container>      
    )
};

export default Home;
